DROP TABLE IF EXISTS `user_activity`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `user_activity` (
  `id` int NOT NULL AUTO_INCREMENT,
  `date` varchar(255) NOT NULL,
  `userActivityRegisterType` enum('steps','workout','compensate') NOT NULL DEFAULT 'steps',
  `minutes` float DEFAULT NULL,
  `steps` int DEFAULT NULL,
  `points` float DEFAULT NULL,
  `x2` tinyint NOT NULL DEFAULT '0',
  `perceivedEffort` int DEFAULT NULL,
  `distanceInKms` float DEFAULT NULL,
  `createdAt` datetime(6) NOT NULL DEFAULT CURRENT_TIMESTAMP(6),
  `updatedAt` datetime(6) NOT NULL DEFAULT CURRENT_TIMESTAMP(6) ON UPDATE CURRENT_TIMESTAMP(6),
  `userId` int NOT NULL,
  `userActivityId` int DEFAULT NULL,
  `capsuleId` int DEFAULT NULL,
  `title` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `FK_c8d8d7cfc6e3433e725339c952b` (`userId`),
  KEY `FK_f8342af0aab75391ee75b9045a3` (`userActivityId`),
  KEY `FK_8ee8f723ae07f5f55e1893b7bc6` (`capsuleId`),
  CONSTRAINT `FK_8ee8f723ae07f5f55e1893b7bc6` FOREIGN KEY (`capsuleId`) REFERENCES `capsule` (`id`) ON DELETE CASCADE,
  CONSTRAINT `FK_c8d8d7cfc6e3433e725339c952b` FOREIGN KEY (`userId`) REFERENCES `user` (`id`) ON DELETE CASCADE,
  CONSTRAINT `FK_f8342af0aab75391ee75b9045a3` FOREIGN KEY (`userActivityId`) REFERENCES `activity_type` (`id`) ON DELETE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=61 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;
